// * scripts.js

var isIE11 = !!window.MSInputMethodContext && !!document.documentMode;
var isIE10 = (navigator.userAgent.match(/MSIE 10/i));

// Get View port width
function getViewportWidth() {
  if (window.innerWidth) {
    return window.innerWidth;
  } else if (document.body && document.body.offsetWidth) {
    return document.body.offsetWidth;
  } else {
    return 0;
  }
}

// Close Navbar
function navBarClose() {
  $(".hamburger").removeClass("is-active");
  $(".jsNavbarToggle").removeClass("is-open");
}
// Open Navbar
function navBarOpen() {
  $(".hamburger").addClass("is-active");
  $(".jsNavbarToggle").addClass("is-open");
}

//filter function
function filtered(fp) {
  if (fp && fp.find('.filter_tab.is-active').length) {
    fp.find('.filter_obj').removeClass('filtered');
    filterBy = [];
    fp.find('.filter_tab.is-active').each(function () {
      filterBy.push($(this).attr('data-filterby'));
    });
    for (i = 0; i < filterBy.length; i++) {
      $.each(fp.find('.filter_obj.' + filterBy[i]), function (i, el) {
        setTimeout(function () {
          $(el).addClass('filtered');
        }, 0 + (i * 100));
      });
    }
  } else {
    $('.filter_obj').addClass('filtered');
  }
}

$(document).ready(function () {
  
  // Navbar toggle
  $(".hamburger").on("click", function () {
    console.log('dfaa');
    if ($(".hamburger").hasClass("is-active")) {
      navBarClose();
    } else {
      navBarOpen();
    }
  });

  //Banner carousel
  if ($(".jsBannerCarousel").length) {
    var bannerCarousel = $(".jsBannerCarousel"); //Banner-carousel for Property-details page
    bannerCarousel.owlCarousel({
      items: 1,
      margin: 5,
      loop: true,
      mouseDrag: true,
      nav: false,
      dots: false,
      // animateIn: isIE11 || isIE10 ? "" : "slideInUp",
      // animateOut: isIE11 || isIE10 ? "" : "slideOutUp",
      smartSpeed: 500,
      autoplay: true,
      autoplayTimeout: 7000,
      autoplayHoverPause: true
    });

    $('.jsCarouselPrv').on('click', function () {
      $(this).closest('.carousel-outer').find(bannerCarousel).trigger('prev.owl.carousel');
    });
    $('.jsCarouselNxt').on('click', function () {
      $(this).closest('.carousel-outer').find(bannerCarousel).trigger('next.owl.carousel');
    });
  };

  //if element exists
  if ($(".jsTestimonialsCarousel").length) {
    var jsTestimonialsCarousel = $(".jsTestimonialsCarousel");
    jsTestimonialsCarousel.owlCarousel({
      // autoHeight: true,
      items: 1,
      loop: true,
      mouseDrag: false,
      nav: false,
      dots: false,
      animateIn: "fade-in",
      animateOut: "fade-out",
      smartSpeed: 500,
      autoplay: true,
      autoplayTimeout: 3000,
      autoplayHoverPause: true,
    });
    $('.jsCarouselPrv').on('click', function () {
      $(this).closest('.carousel-outer').find(jsTestimonialsCarousel).trigger('prev.owl.carousel');
    });
    $('.jsCarouselNxt').on('click', function () {
      $(this).closest('.carousel-outer').find(jsTestimonialsCarousel).trigger('next.owl.carousel');
    });
  }

  //Animate on scroll
  AOS.init({
    once: true,
    easing: 'ease-in-out'
  });

});

// iPhone page refresh on browser back button
$(window).bind("pageshow", function(event) {
  if (event.originalEvent.persisted) {
      window.location.reload();
  }
});